style.css:
@-moz-document domain("www.nitrotype.com")
{
body {
    background: none;  
}
html {
    background: fixed url(https://media.tenor.com/3c1-SIKB2EUAAAAC/satoru-gojo-hanami.gif), #001d45;
    background-size: 100%
}
.card--grit {
    background: none;
}
.bg--gradient {
    background: fixed;
}
.theme--pDefault .profile-bg
{
    background: url("https://media.tenor.com/rKzcjYmD23oAAAAC/gojo-gojo-satoru.gif") top left repeat, linear-gradient(0deg, #2d2e2e 60%, #ffff 100%);
    color: #001367;
    background-size: 107.5%
}

.theme--pDefault .profile-bgHead
{
   background: url("https://media.tenor.com/rKzcjYmD23oAAAAC/gojo-gojo-satoru.gif") top left repeat, linear-gradient(0deg, #2d2e2e 60%, #ffff 100%);
    color: #001367;
    background-size: 107.5%
}

.theme--pDefault.is-gold .profile-bg
{
    background: url("https://media.tenor.com/rKzcjYmD23oAAAAC/gojo-gojo-satoru.gif") top left repeat, linear-gradient(0deg, #2d2e2e 60%, #ffff 100%);
    color: #001367;
    background-size: 107.5%
}
.card--a
{
    background-color: #fff0;
    color: #FDBD01;
}
.dash-copyContainer {
    background: rgba(0, 0, 0, .78);
    box-shadow: 0 1px 157px 10px rgba(0, 0, 0, 0.78);
}
.dash-copy {
    color: #FDBD01;
    font-size: 32px
}
.growl--a {
    background-image: url("https://media.tenor.com/aaYhPJHRe6UAAAAd/gojo-satoru.gif");
    border-color: rgba(2, 2, 2, 0.2);
    background-size: 100%;
    color: #FDBD01;
}
.with-team-ranking .profile--grid--player-info .type-ellip, .with-racer-ranking ,.profile--grid--player-info
.type-ellip {
    color: #001367      
}
.theme--pDefault .profile-username {
    color: #001367
}
.profile-carContainer.card.card--a.card--shadow-l {background-color:#fff0;}
.raceResults-awards {background:#fff0;}
.raceResults-close.raceResults-close--minimizer {background:#f700ff;}
.g.raceResults-grid {background:#fff0;}
.dash-content {background:url("https://media.tenor.com/aaYhPJHRe6UAAAAd/gojo-satoru.gif");
    background-size: 100%
}
.raceResults--default 
{background-image: url("https://w.wallha.com/ws/1/SV9r5sOj.jpg");
          background-size: 100% 
}
}
